import React, { Component } from 'react'

class massage extends Component {
    constructor(){
        super()
        this.state = {
            massage: 'welcome visitor'
        }
    }
    render() {
        return (
            <div>
                {this.state.massage}
            </div>
        )
    }
}

export default massage
